<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>iw</title>
    {% load static %}
    <link rel="stylesheet" href="{% static 'iw/bootstrap.min.css'%}" type='text/css'>
    <link rel="stylesheet" href="{% static 'iw/myStyle.css'%}" type='text/css'>
    <script src="{% static 'iw/bootstrap.bundle.min.js' %}"></script>
    <script src="{% static 'iw/myJS.js' %}"></script>
    <!-- Load plotly.js into the DOM -->
    <script src='https://cdn.plot.ly/plotly-2.6.3.min.js'></script>
    <!-- jquery -->
    <script src="https://code.jquery.com/jquery-3.5.1.min.js"
            integrity="sha256-9/aliU8dGd2tb6OSsuzixeV4y/faTqgFtohetphbbj0="
            crossorigin="anonymous"></script>

    <style>
        .bd-placeholder-img {
            font-size: 1.125rem;
            text-anchor: middle;
            -webkit-user-select: none;
            -moz-user-select: none;
            user-select: none;
        }

        @media (min-width: 768px) {
            .bd-placeholder-img-lg {
              font-size: 3.5rem;
            }
        }
    </style>
</head>


<body>

{% block navbar %}
{% endblock %}

{% block layers %}
{% endblock %}

{% block legends %}
{% endblock %}

{% block systemDiagrams %}
{% endblock %}

{% block historic %}
{% endblock %}

{% block chart %}
{% endblock %}


<script>
    {#var static_url = "{% get_static_prefix %}";#}
    {#var media_url = "{% get_media_prefix %}";#}
    var picture_url = "{% url 'additionalImage' %}";
</script>


</body>
</html>
